model Harmonics_Filter_Symmetrical_Complex_Limiter

equation
	t = time;
	ymag = Selfix(BoolRMS(), 0.0, Select((not BoolRMS()) and (t>t_inc+0.005),sqrt(max(0.0, Sqr(yinr)+Sqr(yini))), 0.0));
	yangle = atan2(yini,yinr);
	ymag_ltd = Selfix(BoolRMS(), 0.0, LimConst(ymag, 0.0, y_max));  // Limitation of magnitude
	youtr = Selfix(BoolRMS(), 0.0, Select(Enable and (( not FRT) or Mode_FRT), ymag_ltd*cos(yangle), 0.0));  // Limitation of real part under consideration of imaginary part while ensuring magnitude is within limit
	youti = Selfix(BoolRMS(), 0.0, Select(Enable and (( not FRT) or Mode_FRT), ymag_ltd*sin(yangle), 0.0));  // Limitation of imaginary part under consideration of real part while ensuring magnitude is within limit

end Harmonics_Filter_Symmetrical_Complex_Limiter;

