	output Boolean yo;
algorithm
	domainType = 1; // 1 for RMS, 0 for EMT simulation
	if domainType = 1 then
		yo = True;
	else
		yo = False;
	end if;
end BoolRMS;

model Harmonics_Filter_Integrator_with_gain_9

equation
	der(x) = Selfix(BoolRMS(), 0.0, (K*yi));
	yo = Selfix(BoolRMS(), 0.0, LimState(x,-y_max,y_max));
end Harmonics_Filter_Integrator_with_gain_9;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function BoolRMS
	parameter Integer domainType (start=1);
	output Boolean yo;
algorithm
	domainType = 1; // 1 for RMS, 0 for EMT simulation
	if domainType = 1 then
		yo = True;
	else
		yo = False;
	end if;
end BoolRMS;

function LimState
	input Real x1 (stateSelect=StateSelect.always);
	input Real xmin;
	input Real xmax;
	output Real yo;
algorithm
	domainType = 1; // 1 for RMS, 0 for EMT simulation
	if x < xmin then
		yo = xmin;
	else if x > xmax then
		yo = xmax;
	else
		yo = x1;
	end if;
end LimState;

model Harmonics_Filter_dq_to_alpha_beta_4


equation
	alpha = Selfix(BoolRMS(), 0.0, (d*cosphi - q*sinphi));
	beta  = Selfix(BoolRMS(), 0.0, (d*sinphi + q*cosphi));

end Harmonics_Filter_dq_to_alpha_beta_4;


